import React, { Component } from 'react'
import { Nav, NavItem, Navbar, } from 'react-bootstrap'

class Header extends Component {

    render() {
        return(
            <div>
                <Navbar>
                    <Navbar.Header>
                        <Navbar.Brand>
                            <a href="#">CEA</a>
                        </Navbar.Brand>
                    </Navbar.Header>

                    <Nav>
                        <NavItem eventKey={1}>Login</NavItem>
                    </Nav>
                </Navbar>
            </div>
        )
    }
}

export default Header;
